import { Component, OnInit } from '@angular/core';
import { AdminService } from '../shared/services/admin.service';
import { NzMessageService } from 'ng-zorro-antd/message';
import mappingOf50States from './listOf50States';
import {isDigit} from 'codelyzer/angular/styles/chars';

export enum Status {
  Active,
  Unverified,
  Blocked,
}

export interface User {
  userId: string;
  firstName: string;
  lastName: string;
  avatar: string;
  email: string;
  phoneNumber: number;
  emailVerified: boolean;
  userAccounts: any[];
  superAdmin: boolean;
}

export interface Account {
  id: string;
  name: string;
  segment: string[];
  superAdmin?: boolean;
  users: User[];
  isDisabled: boolean;
  status: {[userId: string]: Status};
}


@Component({
  selector: 'exp-admin',
  templateUrl: './admin.component.html',
  styleUrls: ['./admin.component.scss']
})
export class AdminComponent implements OnInit {
  statusType = Status;
  accountsLoading = false;
  expandedAccountId = '';
  newAccountRowIsHidden = true;
  newAccountProcessing = false;
  inputAccountName = '';
  selectedSegments: string[] = [];
  mappingOf50States: any;
  listOfSegmentOptions: string[] = [];
  usersLoading = false;
  inputEmailValue = '';
  inputNameValue = '';
  editId = '';
  editName = '';
  showActionMenu: {[userId: string]: boolean} = {};
  showPasswordResetAlert = false;
  allChecked = false;
  setOfCheckedId = new Set<string>();
  currentPageUsers: User[] = [];
  indeterminate = false;
  accounts: Account[] = [{
    name: 'Super Admins',
    segment: [],
    superAdmin: true,
    users: [],
    id: '1',
    status: {},
    isDisabled: false,
  }];
  users: User[] = [];

  constructor(private adminService: AdminService, private message: NzMessageService) { }

  ngOnInit(): void {
    this.mappingOf50States = mappingOf50States;
    this.accountsLoading = true;
    this.listOfSegmentOptions = Object.keys(mappingOf50States);
    this.adminService.getAccounts().subscribe(accounts => {
      accounts.forEach((act: Account) => {act.users = []; });
      this.accounts = [...this.accounts, ...accounts];
      this.adminService.getUsers().subscribe(users => {
        this.users = users;
        this.assignUsersToAccounts();
      });
    });
  }

  addAccount(name: string, segment: string[]): void {
    this.newAccountProcessing = true;
    this.accountsLoading = true;
    this.adminService.createAccount(name, segment).subscribe(accounts => {
      this.accountsLoading = false;
      this.newAccountProcessing = false;
      this.newAccountRowIsHidden = true;
      const account = accounts.pop();
      account.users = [];
      this.accounts.splice(1, 0, account);
      this.accounts = [...this.accounts];
    });
  }

  disableAccount(account: Account, isActive: boolean): void {
    this.accountsLoading = true;
    const isDisabled = !isActive;
    this.adminService.disableAccount(account.id, isDisabled).subscribe(() => {
      this.accountsLoading = false;
      account.isDisabled = isDisabled;
    });
  }

  assignUsersToAccounts(): void {
    this.accounts = this.accounts.map((account: Account) => {
      account.users = this.getUsersForAccount(account);
      account.status = account.users.reduce((statusObj: any, user) => {
        statusObj[user.userId] = this.getStatus(user, account.id);
        return statusObj;
      }, {});
      return account;
    });
    this.usersLoading = false;
    this.accountsLoading = false;
  }

  getUsersForAccount(account: Account): User[] {
    if (account.superAdmin) {
      return this.users.filter(user => user.superAdmin);
    }
    return this.users.filter( user => {
      const userBelongsToAccount = user.userAccounts.some(
        userAccount => userAccount.account === account.id
      );
      return userBelongsToAccount;
    });
  }

  getStatus(user: User, accountId: string): Status {
    const userAccount = user.userAccounts.find(account => account.account === accountId);

    if (!user.emailVerified) {
      return Status.Unverified;
    }

    if (userAccount && userAccount.blocked) {
      return Status.Blocked;
    }
    return Status.Active;
  }

  addUser(email: string, userName: string, account: Account): void {
    const user = this.users.find(potentialUser => potentialUser.email === email);
    const isSuperAdmin = !!account.superAdmin;
    this.usersLoading = true;
    this.inputEmailValue = '';
    this.inputNameValue = '';
    const [firstName, lastName] = userName.trim().split(' ');
    if (account.users.find(accountUser => accountUser === user)) {
      this.message.error(`${email} is already add to ${account.name}`, { nzDuration: 2500 });
      this.usersLoading = false;
    }
    if (user) {
      if (isSuperAdmin) {
        this.adminService.assignSuperAdminToUser(user.userId, true).subscribe(users => {
          const updatedUser = users.pop();
          this.updateUserHelper(updatedUser);
        });
        return;
      }
      this.adminService.addUserToAccount(user.userId, account.id).subscribe(users => {
        const updatedUser = users.pop();
        this.updateUserHelper(updatedUser);
      });
      return;
    }

    if (!user){
      // Only invite if user doesn't exist
      this.adminService.inviteUser(email, account.id, firstName, lastName, isSuperAdmin).subscribe(users => {
        const newUser = users.pop();
        this.users = [...this.users, newUser];
        this.assignUsersToAccounts();
      });
    }
  }

  startEdit(user: User): void {
    this.editId = user.userId;
    this.editName = user.firstName + (user.lastName ? ` ${user.lastName}` : '');
    return;
  }

  stopEdit(): void {
    this.editId = '';
    this.editName = '';
    return;
  }

  saveEdit(user: User): void {
    this.usersLoading = true;
    const listOfNames = this.editName.trim().split(' ');
    if (listOfNames.length > 2) {
      this.message.error('Please provided only a first name and a last name');
      this.usersLoading = false;
      return;
    }
    const [firstName, lastName] = listOfNames;
    this.adminService.updateUser(user.userId, firstName, lastName).subscribe((users: any) => {
      const updatedUser = users.pop();
      this.updateUserHelper(updatedUser);
      this.usersLoading = false;
    });
    this.stopEdit();
  }

  removeUser(userId: string, account: Account): void {
    this.usersLoading = true;
    if (account.superAdmin) {
        this.adminService.assignSuperAdminToUser(userId, false).subscribe((users: any) => {
          const updatedUser = users.pop();
          this.updateUserHelper(updatedUser);
        });
        return;
    }
    this.adminService.removeUserFromAccount(userId, account.id).subscribe((users: any) => {
      const updatedUser = users.pop();
      this.updateUserHelper(updatedUser);
    });
  }

  blockUser(userId: string, accountId: string, shouldBlock: boolean): void {
    this.usersLoading = true;
    this.adminService.blockUserFromAccount(userId, accountId, shouldBlock).subscribe((users: any) => {
      this.usersLoading = false;
      const blockedUser = users.pop();
      this.updateUserHelper(blockedUser);
    });
  }

  updateUserHelper(updatedUser: User): void {
    this.users = this.users.map(user => {
      if (user.userId === updatedUser.userId) {
        return updatedUser;
      }
      return user;
    });
    this.assignUsersToAccounts();
  }

  resendInvite(email: string, userId: string, accountId: string): void {
    this.adminService.resendInviteToUser(email, userId, accountId).subscribe(() => {
      this.message.success(`Invite email sent to ${email}`, { nzDuration: 2500 });
    });
  }

  resetPassword(user: any): void {
    this.adminService.resetPassword(user.userId, user.email).subscribe( UpdatedUser => {
      this.showPasswordResetAlert = true;
      setInterval(() => {
        this.showPasswordResetAlert = false;
      }, 5000);
    });
  }

  updateCheckedSet(userId: string, checked: boolean): void {
    if (checked) {
      this.setOfCheckedId.add(userId);
    } else {
      this.setOfCheckedId.delete(userId);
    }
  }

  onItemChecked(userId: string, checked: boolean): void {
    this.updateCheckedSet(userId, checked);
    this.refreshCheckedStatus();
  }

  refreshCheckedStatus(): void {
    // this.setOfCheckedId.forEach(item => console.log(item));
    this.allChecked = this.users.every(({ userId }) => this.setOfCheckedId.has(userId));
    this.indeterminate = this.users.some(({ userId }) => this.setOfCheckedId.has(userId)) && !this.allChecked;
  }

  onAllChecked(checked: boolean): void {
    this.users.forEach(({ userId }) => this.updateCheckedSet(userId, checked));
    this.refreshCheckedStatus();
  }

  onExpandChange(accountId: string, checked: boolean): void {
    this.expandedAccountId = checked ? accountId : '';
  }

  showNewAccountRow(): void {
    this.newAccountRowIsHidden = false;
  }
}

import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';
import { HttpClient } from '@angular/common/http';
import {last, map} from 'rxjs/operators';
import {environment} from '../../../environments/environment';

export interface AccountResponse {
  id: string;
  name: string;
  segment: string[];
  isDisabled: boolean;
}

export interface UserResponse {
  user_id: string;
  email: string;
  phone_number: number;
  first_name: string;
  last_name: string;
  email_verified: boolean;
  accounts: any;
  is_super_admin: boolean;
}

@Injectable({
  providedIn: 'root'
})
export class AdminService {
  apiUrl: string = environment.apiURL;

  constructor(private http: HttpClient) {
    if (environment.apiURL === '{PLACEHOLDER}') {
      switch (window.location.hostname) {
        case 'login.civicexplorer.com':
          this.apiUrl = 'https://api.civicexplorer.com';
          break;
        case 'staging-www.civicexplorer.com':
          this.apiUrl = 'https://staging-api.civicexplorer.com';
          break;
        case 'sandbox-www.civicexplorer.com':
          this.apiUrl = 'https://sandbox-api.civicexplorer.com';
          break;
      }
    }
  }

  getAccounts(): Observable<any> {
    return this.http.get<any>(this.apiUrl + '/explorer/account/all')
    .pipe(map(res => {
      return res.data.map((data: AccountResponse) => this.transformAccountData(data));
    }));
  }

  createAccount(name: string, segment: string[]): Observable<any> {
    const body = { name, segment };
    return this.http.post<any>(this.apiUrl + '/explorer/account/create', body)
    .pipe(map(res => {
      return res.data.map((data: AccountResponse) => this.transformAccountData(data));
    }));
  }

  disableAccount(accountId: string, isDisabled: boolean): Observable<any> {
    const body = {id: accountId, isDisabled};
    return this.http.post<any>(this.apiUrl + '/explorer/account/disable', body)
    .pipe(map(res => {
      return res.data.map((data: AccountResponse) => this.transformAccountData(data));
    }));
  }

  transformAccountData(accountData: any): any {
    return {
      id: accountData.id,
      name: accountData.name,
      segment: accountData.segment,
      isDisabled: accountData.isDisabled
    };
  }

  getUsers(): Observable<any> {
    return this.http.get<any>(this.apiUrl + '/explorer/user/all')
    .pipe(map(res => {
      return res.data.map((data: UserResponse) => this.transformUserData(data));
    }));
  }

  updateUser(userId: string, firstName: string, lastName: string): Observable<any> {
    const body = {user_id: userId,  first_name: firstName, last_name: lastName};
    return this.http.post<any>(this.apiUrl + '/explorer/user/update', body)
    .pipe(map(res => {
      return res.data.map((data: UserResponse) => this.transformUserData(data));
    }));
  }

  inviteUser(email: string, accountId: string, firstName: string, lastName: string, isSuperAdmin: boolean): Observable<any> {
    const body = { email, account_id: accountId, is_super_admin: isSuperAdmin, first_name: firstName, last_name: lastName};
    return this.http.post<any>(this.apiUrl + '/explorer/user/invite', body)
    .pipe(map(res => {
      return res.data.map((data: UserResponse) => this.transformUserData(data));
    }));
  }

  resendInviteToUser(email: string, userId: string, accountId: string): Observable<any> {
    const body = { email, user_id: userId, account_id: accountId};
    return this.http.post<any>(this.apiUrl + '/explorer/user/invite', body);
  }

  assignSuperAdminToUser(userId: string, isSuperAdmin: boolean): Observable<any> {
    const body = { user_id: userId, is_super_admin: isSuperAdmin};
    return this.http.post<any>(this.apiUrl + '/explorer/user/make_super_admin', body)
    .pipe(map(res => {
      return res.data.map((data: UserResponse) => this.transformUserData(data));
    }));
  }

  addUserToAccount(userId: string, accountId: string): Observable<any> {
    const body = { user_id: userId, account_id: accountId };
    return this.http.post<any>(this.apiUrl + '/explorer/user/add_to_account', body)
    .pipe(map(res => {
      return res.data.map((data: UserResponse) => this.transformUserData(data));
    }));
  }

  removeUserFromAccount(userId: string, accountId: string): Observable<any> {
    const body = { user_id: userId, account_id: accountId };
    return this.http.post<any>(this.apiUrl + '/explorer/user/remove_from_account', body)
    .pipe(map(res => {
      return res.data.map((data: UserResponse) => this.transformUserData(data));
    }));
  }

  blockUserFromAccount(userId: string, accountId: string, shouldBlock: boolean): Observable<any> {
    const body = {
      user_id: userId,
      account_id: accountId,
      blocked: shouldBlock
    };
    return this.http.post<any>(this.apiUrl + '/explorer/user/block_from_account', body)
    .pipe(map(res => {
      return res.data.map((data: UserResponse) => this.transformUserData(data));
    }));
  }

  resetPassword(userId: string, email: string): Observable<any> {
    const body = { email, user_id: userId};
    return this.http.post<any>(this.apiUrl + '/explorer/user/reset_password', body)
    .pipe(map(res => {
      return res.data.map((data: UserResponse) => this.transformUserData(data));
    }));
  }

  transformUserData(userData: any): any {
    return {
      userId: userData.user_id,
      avatar: userData.avatar,
      email: userData.email,
      emailVerified: userData.email_verified,
      phoneNumber: userData.phone_number,
      firstName: userData.first_name,
      lastName: userData.last_name,
      userAccounts: userData.accounts,
      superAdmin: userData.is_super_admin,
    };
  }
}

