import { Injectable } from '@angular/core';
import { CanActivate, Router, UrlTree } from '@angular/router';
import { Observable, of } from 'rxjs';
import { map } from 'rxjs/operators';
import { CurrentUserService } from './current-user.service';

@Injectable({
  providedIn: 'root'
})
export class AccountSelectionGuard implements CanActivate {

  constructor(
    private currentUserService: CurrentUserService,
    private router: Router,
  ) { }

  canActivate(): Observable<boolean | UrlTree> {
    // Already have a selected account
    return this.currentUserService.getAccount().pipe(
      map((account: any) => {
        if (account) {
          return true;
        } else {
          return this.router.createUrlTree(['/accounts']);
        }
      }));
  }
}

import { Injectable } from '@angular/core';
import { CanActivate, Router } from '@angular/router';
import { Observable } from 'rxjs';

@Injectable()
export class AuthGuardMaintenance implements CanActivate {
  turnMaintenanceOn = false;

  constructor(
      private router: Router
  ) {}

  canActivate(): Observable<boolean> | Promise<boolean> | boolean {
    if (this.turnMaintenanceOn) {
      this.router.navigate(['/maintenance']).then();
      return false;
    } else {
      return true;
