  indeterminate = false;
  accounts: Account[] = [{
    name: 'Super Admins',
    segment: [],
    superAdmin: true,
    users: [],
    id: '1',
    status: {},
    isDisabled: false,
  }];
  users: User[] = [];

  constructor(private adminService: AdminService, private message: NzMessageService) { }

  ngOnInit(): void {
    this.mappingOf50States = mappingOf50States;
    this.accountsLoading = true;
    this.listOfSegmentOptions = Object.keys(mappingOf50States);
    this.adminService.getAccounts().subscribe(accounts => {
      accounts.forEach((act: Account) => {act.users = []; });
      this.accounts = [...this.accounts, ...accounts];
      this.adminService.getUsers().subscribe(users => {
        this.users = users;
        this.assignUsersToAccounts();
      });
    });
  }

  addAccount(name: string, segment: string[]): void {
    this.newAccountProcessing = true;
    this.accountsLoading = true;
    this.adminService.createAccount(name, segment).subscribe(accounts => {
      this.accountsLoading = false;
      this.newAccountProcessing = false;
      this.newAccountRowIsHidden = true;
      const account = accounts.pop();
      account.users = [];
      this.accounts.splice(1, 0, account);
      this.accounts = [...this.accounts];
    });
  }

  disableAccount(account: Account, isActive: boolean): void {
    this.accountsLoading = true;
    const isDisabled = !isActive;
    this.adminService.disableAccount(account.id, isDisabled).subscribe(() => {
      this.accountsLoading = false;
      account.isDisabled = isDisabled;
    });
  }

  assignUsersToAccounts(): void {
    this.accounts = this.accounts.map((account: Account) => {
      account.users = this.getUsersForAccount(account);
      account.status = account.users.reduce((statusObj: any, user) => {
        statusObj[user.userId] = this.getStatus(user, account.id);
        return statusObj;
      }, {});
      return account;
    });
    this.usersLoading = false;
    this.accountsLoading = false;
  }

  getUsersForAccount(account: Account): User[] {
    if (account.superAdmin) {
      return this.users.filter(user => user.superAdmin);
    }
    return this.users.filter( user => {
      const userBelongsToAccount = user.userAccounts.some(
        userAccount => userAccount.account === account.id
      );
      return userBelongsToAccount;
    });
  }

  getStatus(user: User, accountId: string): Status {
    const userAccount = user.userAccounts.find(account => account.account === accountId);

    if (!user.emailVerified) {
      return Status.Unverified;
    }

    if (userAccount && userAccount.blocked) {
      return Status.Blocked;
    }
    return Status.Active;
  }

  addUser(email: string, userName: string, account: Account): void {
    const user = this.users.find(potentialUser => potentialUser.email === email);
    const isSuperAdmin = !!account.superAdmin;
    this.usersLoading = true;
    this.inputEmailValue = '';
    this.inputNameValue = '';
    const [firstName, lastName] = userName.trim().split(' ');
    if (account.users.find(accountUser => accountUser === user)) {
      this.message.error(`${email} is already add to ${account.name}`, { nzDuration: 2500 });
      this.usersLoading = false;
    }
    if (user) {
      if (isSuperAdmin) {
        this.adminService.assignSuperAdminToUser(user.userId, true).subscribe(users => {
          const updatedUser = users.pop();
          this.updateUserHelper(updatedUser);
        });
        return;
      }
      this.adminService.addUserToAccount(user.userId, account.id).subscribe(users => {
        const updatedUser = users.pop();
        this.updateUserHelper(updatedUser);
      });
      return;
    }

    if (!user){
      // Only invite if user doesn't exist
      this.adminService.inviteUser(email, account.id, firstName, lastName, isSuperAdmin).subscribe(users => {
        const newUser = users.pop();
        this.users = [...this.users, newUser];
        this.assignUsersToAccounts();
      });
    }
  }

  startEdit(user: User): void {
    this.editId = user.userId;
    this.editName = user.firstName + (user.lastName ? ` ${user.lastName}` : '');
    return;
  }

  stopEdit(): void {
    this.editId = '';
    this.editName = '';
    return;
  }

  saveEdit(user: User): void {
    this.usersLoading = true;
    const listOfNames = this.editName.trim().split(' ');
    if (listOfNames.length > 2) {
      this.message.error('Please provided only a first name and a last name');
      this.usersLoading = false;
      return;
    }
    const [firstName, lastName] = listOfNames;
    this.adminService.updateUser(user.userId, firstName, lastName).subscribe((users: any) => {
      const updatedUser = users.pop();
      this.updateUserHelper(updatedUser);
      this.usersLoading = false;
    });
    this.stopEdit();
  }

  removeUser(userId: string, account: Account): void {
    this.usersLoading = true;
    if (account.superAdmin) {
        this.adminService.assignSuperAdminToUser(userId, false).subscribe((users: any) => {
          const updatedUser = users.pop();
          this.updateUserHelper(updatedUser);
        });
        return;
    }
    this.adminService.removeUserFromAccount(userId, account.id).subscribe((users: any) => {
      const updatedUser = users.pop();
      this.updateUserHelper(updatedUser);
    });
  }

  blockUser(userId: string, accountId: string, shouldBlock: boolean): void {
    this.usersLoading = true;
    this.adminService.blockUserFromAccount(userId, accountId, shouldBlock).subscribe((users: any) => {
      this.usersLoading = false;
      const blockedUser = users.pop();
      this.updateUserHelper(blockedUser);
    });
  }

  updateUserHelper(updatedUser: User): void {
    this.users = this.users.map(user => {
      if (user.userId === updatedUser.userId) {
        return updatedUser;
      }
      return user;
    });
    this.assignUsersToAccounts();
  }

  resendInvite(email: string, userId: string, accountId: string): void {
    this.adminService.resendInviteToUser(email, userId, accountId).subscribe(() => {
      this.message.success(`Invite email sent to ${email}`, { nzDuration: 2500 });
    });
  }

  resetPassword(user: any): void {
    this.adminService.resetPassword(user.userId, user.email).subscribe( UpdatedUser => {
      this.showPasswordResetAlert = true;
      setInterval(() => {
        this.showPasswordResetAlert = false;
      }, 5000);
    });
  }

  updateCheckedSet(userId: string, checked: boolean): void {
    if (checked) {
      this.setOfCheckedId.add(userId);
    } else {
      this.setOfCheckedId.delete(userId);
    }
  }

  onItemChecked(userId: string, checked: boolean): void {
    this.updateCheckedSet(userId, checked);
    this.refreshCheckedStatus();
  }

  refreshCheckedStatus(): void {
    // this.setOfCheckedId.forEach(item => console.log(item));
    this.allChecked = this.users.every(({ userId }) => this.setOfCheckedId.has(userId));
    this.indeterminate = this.users.some(({ userId }) => this.setOfCheckedId.has(userId)) && !this.allChecked;
  }

  onAllChecked(checked: boolean): void {
    this.users.forEach(({ userId }) => this.updateCheckedSet(userId, checked));
    this.refreshCheckedStatus();
  }

  onExpandChange(accountId: string, checked: boolean): void {
    this.expandedAccountId = checked ? accountId : '';
  }

  showNewAccountRow(): void {
    this.newAccountRowIsHidden = false;
  }
}

