import { Component, OnInit } from '@angular/core';
import { NavigationStart, Router } from '@angular/router';
import { AuthService } from '@auth0/auth0-angular';
import { CurrentUserService } from '../../services/current-user.service';
import { MixpanelService } from '../../services/mixpanel.service';
import { IntercomService } from '../../services/intercom.service';

@Component({
  selector: 'exp-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.scss']
})
export class HeaderComponent implements OnInit {

  constructor(
    public auth: AuthService,
    public currentUserService: CurrentUserService,
    private router: Router,
    public mixpanel: MixpanelService,
    public intercom: IntercomService
  ) { }

  accountName = '';
  accounts: any;
  isAdmin = false;

  ngOnInit(): void {
    this.intercom.boot();
    this.mixpanel.init();
    this.updateUser();
    this.router.events.subscribe((event) => {
      if (event instanceof NavigationStart) {
        this.updateUser();
      }
    });
  }

    updateUser(): void {
      this.currentUserService.isSuperAdmin().subscribe((isSuperAdmin: boolean) => {
        // console.log('super admin', isSuperAdmin);
        this.isAdmin = isSuperAdmin;
      });
      this.currentUserService.getAccount().subscribe((account: any) => {
        if (account) {
          this.mixpanel.identify(account.account);
        }
        this.accountName = account?.name;
        if (this.accountName) {
          this.currentUserService.getUser().subscribe(user => {
            if (user) {
              this.mixpanel.register({accountNumber: user.sub, accountName: user.nickname, accountEmail: user.name, $name: user.nickname, $email: user.name});
              this.mixpanel.setPeople({$name: user.nickname, $email: user.name});
            }
          });
        }
        this.currentUserService.getAccounts().subscribe((accounts: any) => {
          this.accounts = accounts;
        });
      });
    }

    switchAccount(): void {
      this.currentUserService.clearAccountSelection();
      this.router.navigate(['accounts']).then();
    }
}

