})
export class HomeComponent implements OnInit {
  constructor(
    public auth: AuthService,
    private router: Router,
    private intercom: IntercomService,
    private currentUserService: CurrentUserService,
  ) {}

  ngOnInit(): void {
    this.currentUserService.getUser().subscribe((user: any) => {
      if (user) {
        this.currentUserService.getAccount().subscribe((account: any) => {
          if (account) {
            this.router.navigate(['/dashboard']);
          } else {
            this.router.navigate(['/accounts']);
          }
        });
        if (user) {
          this.intercom.fetchHash(user.email).subscribe((intercomHash: any) => {
            this.intercom.updateForUser(user, intercomHash);
          });
        }
      } else {
        this.auth.loginWithPopup();
      }
    });
  }
}

